import React from 'react';

const Experience = () => {
    const experiences = [
        {
            title: 'Job Title 1',
            company: 'Company Name 1',
            responsibilities: 'Responsibilities for Job Title 1'
        },
        {
            title: 'Job Title 2',
            company: 'Company Name 2',
            responsibilities: 'Responsibilities for Job Title 2'
        },
        {
            title: 'Job Title 3',
            company: 'Company Name 3',
            responsibilities: 'Responsibilities for Job Title 3'
        }
    ];

    return (
        <div className="experience">
            <h2>Experience</h2>
            <ul>
                {experiences.map((exp, index) => (
                    <li key={index}>
                        <h3>{exp.title} at {exp.company}</h3>
                        <p>{exp.responsibilities}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Experience;
